import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import Header from './Header';

const App = () => {
	return (
		<div>
			<BrowserRouter>
				<Route path="/" component={Header} />
			</BrowserRouter>
		</div>
	);
};

export default App;
